package com.idega.xformsmanager.component;import java.lang.annotation.ElementType;import java.lang.annotation.Retention;import java.lang.annotation.RetentionPolicy;import java.lang.annotation.Target;import org.springframework.beans.factory.annotation.Qualifier;/** * @author <a href="mailto:civilis@idega.com">Vytautas ÄŒivilis</a> * @version $Revision: 1.1 $ *  *          Last modified: $Date: 2008/10/31 18:30:43 $ by $Author: civilis $ */@Target( { ElementType.FIELD, ElementType.METHOD, ElementType.TYPE,		ElementType.PARAMETER })@Retention(RetentionPolicy.RUNTIME)@Qualifierpublic @interface FormComponentType {	public static final String button = "button";	public static final String container = "container";	public static final String document = "document";	public static final String base = "base";	public static final String multiupload = "multiupload";	public static final String page = "page";	public static final String plain = "plain";	public static final String select = "select";	public static final String thankYouPage = "thankYouPage";	String value();}